import React from "react";
import { useState } from "react";
import { styled } from "styled-components";

import Icon from "../components/Icon";



export default function TableManagement(){
    const [zoomLevel, setZoomLevel] = useState(1);

    const Grid = styled.div` 
        background-size: ${40 + 1*zoomLevel}px ${40 + 1*zoomLevel}px;   
    `

    const TableImg = styled.img` 
        width: 60%;
        height: 60%;
    `

    const handleZoomLevel = value => {
        console.log(zoomLevel);
        setZoomLevel(zoomLevel + value);
    };

    dragElement(document.getElementById("mydiv"));

    function dragElement(elmnt) {
      var pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;
      if (document.getElementById(elmnt.id + "header")) {
        // if present, the header is where you move the DIV from:
        document.getElementById(elmnt.id + "header").onmousedown = dragMouseDown;
      } else {
        // otherwise, move the DIV from anywhere inside the DIV:
        elmnt.onmousedown = dragMouseDown;
      }

      function dragMouseDown(e) {
        e = e || window.event;
        e.preventDefault();
        // get the mouse cursor position at startup:
        pos3 = e.clientX;
        pos4 = e.clientY;
        document.onmouseup = closeDragElement;
        // call a function whenever the cursor moves:
        document.onmousemove = elementDrag;
      }

      function elementDrag(e) {
        e = e || window.event;
        e.preventDefault();
        // calculate the new cursor position:
        pos1 = pos3 - e.clientX;
        pos2 = pos4 - e.clientY;
        pos3 = e.clientX;
        pos4 = e.clientY;
        // set the element's new position:
        elmnt.style.top = (elmnt.offsetTop - pos2) + "px";
        elmnt.style.left = (elmnt.offsetLeft - pos1) + "px";
      }

      function closeDragElement() {
        // stop moving when mouse button is released:
        document.onmouseup = null;
        document.onmousemove = null;
      }
    }

    return(
        <div className="table-management">
            <div className="table-grid-container">
                <div className="table-zoom-settings">
                    <button onClick={()=>handleZoomLevel(10)}>+</button>
                    <button onClick={()=>handleZoomLevel(-10)}>-</button>
                    <button>100%</button>
                </div>
                <Grid className="table-grid">

                </Grid>
            </div>
            <div className="table-presets">
                <h3 className="edit-tables-title">Edit Tables</h3>
                <div className="table-options">
                    <div className="table-option" onMouseDown={handleDrag}>
                        <img className="draggable-icon" src="/assets/icons/draggable-icon.svg"/>
                        <TableImg src="/assets/icons/tables/round-table.svg"/>
                    </div>
                    <div className="table-option">
                        <img className="draggable-icon" src="/assets/icons/draggable-icon.svg"/>
                        <TableImg src="/assets/icons/tables/square-table.svg"/>
                    </div>
                    <div className="table-option">
                        <img className="draggable-icon" src="/assets/icons/draggable-icon.svg"/>
                        <TableImg src="/assets/icons/tables/wide-rectangle-table.svg"/>
                    </div>
                    <div className="table-option">
                        <img className="draggable-icon" src="/assets/icons/draggable-icon.svg"/>
                        <TableImg src="/assets/icons/tables/long-rectangle-table.svg"/>
                    </div>
                </div>

                <div className="saved-presets">

                </div>

                <div className="preset-buttons">
                    <button>Save Preset</button>
                    <button>Delete Preset</button>
                </div>
            </div>
        </div>

    )
}
